import { HStack, Box } from "@chakra-ui/react";
import { Link } from "react-router-dom";

function NavBar() {
    return(
        <Box background="black">
            <nav>
                <HStack spacing='24px' textColor="white">
                    <Link to="/">Home</Link>
                    <Link to="/about">About</Link>
                    <Link to="/courses">Courses</Link>
                </HStack>
            </nav>
        </Box>
    );
}

export default NavBar;
